import React, { Component } from 'react';
import { useParams } from "react-router-dom";
import axios from 'axios'

export default class Propiedad extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state

        return (
            <div>
                <Use
                    list={ prop }
                />
            </div>
        )
    }
}

function Use(props) {
    let { id } = useParams();
    return (
        <div>
            <h3>ID: {id}</h3>

                {props.list.map((item, index) => {

                    if (props.render) {
                        return render(item, index)
                    }

                    return (
                        <li key={item.name}>
                            { item.name}
                        </li>
                    )
                })}

        </div>
    );
}
